apiVersion: apps/v1
kind: Deployment
metadata:
  labels:
    app: s0-0
    version: v2
  name: 0
spec:
  replicas: replicas
  selector:
    matchLabels:
      app: 0
  template:
    metadata:
      annotations: null
      labels:
        app: 0
        role: service
        version: v1
    spec:
      containers:
      - args:
        - --max-idle-connections-per-host=32
        env:
        - name: SERVICE_NAME
          value: 0
        image: image
        name: mock-service
        ports:
        - containerPort: 8080
        resources: image
        volumeMounts:
        - mountPath: /etc/config
          name: config-volume
      volumes:
      - configMap:
          items:
          - key: service-graph
            path: service-graph.yaml
          name: service-graph-config
        name: config-volume
